```c
#include <math.h>

float symmetric_ease(float t, float p) {
    if (t < 0.5f) {
        return 0.5f * powf(2.0f * t, p);
    } else {
        return 1.0f - 0.5f * powf(2.0f * (1.0f - t), p);
    }
}
```

**Explanation:**

1. **Input Parameters:**
   - `t`: Time progression (normalized between 0.0 and 1.0)
   - `p`: Exponent controlling the strength of the easing (higher values = sharper curve)

