   - **First Half (t < 0.5):** Ease-in using `(2t)^p`. Scaled by 0.5 to keep within [0, 0.5].
   - **Second Half (t >= 0.5):** Ease-out using `1 - 0.5 * (2(1-t))^p`. Mirrors the first half.

3. **Properties:**
   - Symmetric: The ease-in and ease-out curves are mirror images.
   - Customizable: Adjust `p` to change curve intensity:
     - `p = 1`: Linear slope
     - `p > 1`: Accelerated easing (e.g., `p=2` for quadratic)
