## Wat is een SP3-bestand?

Een bestand met de extensie .sp3 is een GPS-orbitsformaat dat is ontwikkeld door het National Geodetic Survey (NGS). Het wordt gebruikt om orbitale informatie op te slaan die wordt gebruikt door Global Navigation Satellite Systems (GNSS) zoals GPS, GLONASS, Galileo en Sputnik. Dit is gebaseerd op het [IEEE](https://en.wikipedia.org/wiki/Institute_of_Electrical_and_Electronics_Engineers) 32-bits drijvende-komma-representatie en bevat zowel de positie als de klokcorrectie-informatie voor satellieten. Het werd ontwikkeld door Remondi en wordt ook wel Extended Standard Product 3 Format genoemd. Het wordt gebruikt door geodetische software zoals GPSurvey van NGS en GAMIT. SP3-bestanden kunnen worden geopend met de TEQC-toolkit (Translating, Editing and Quality Checking) van UNAVCO, een non-profitorganisatie die ondersteuning biedt voor geowetenschappelijk onderzoek.

## SP3-bestandsindeling - Meer informatie

SP3-bestanden worden gegenereerd en opgeslagen op schijf in ASCII-bestandsindeling. De interne structuur van een SP3-bestand bestaat uit een header die wordt gevolgd door gegevensregels die de orbitale informatie bevatten voor elk tijdsinterval. Elke regel bevat orbitale informatie voor één satelliet, samen met klokcorrectie-informatie. De lengte van een regel is beperkt tot 61 tekens, inclusief een nieuwe regel (meer informatie in het SP3c-formaat). De header bevat informatie zoals het jaar, het aantal weken, de dag van de week, het aantal tijdspunten, de gebruikte coördinaten, de orbitale type-informatie en de satellietacroniemen. De SP3-bestandsindeling is geëvolueerd van SP3-a naar SP3-b en vervolgens naar SP3-c en SP3-d.

