// 1. The problem: We are given a string `s` and an integer `k`. We need to find the length of the longest substring of `s` that contains at most `k` distinct characters.
// 2. Approach: We can use a sliding window technique with two pointers (left and right) and a data structure to keep track of the distinct characters in the current window and their counts.
// 3. Data Structure: We can use a HashMap (or unordered_map in C++) to store the frequency of each character in the current window.
// 4. Steps:
//    - Initialize left = 0, right = 0, and a variable maxLength = 0.
//    - Expand the window by moving right pointer. For each new character at right, add it to the map and increment its count.
//    - While the number of distinct characters (map.size()) exceeds k:
//          - Decrement the count of the character at left in the map.
//          - If the count becomes zero, remove that character from the map.
//          - Move the left pointer to the right.
//    - Update maxLength as the maximum of current maxLength and (right - left).
//    - Continue until right reaches the end of the string.
// 5. Edge Cases: 
//    - If k is 0, then we return 0 because we cannot have any distinct character.
//    - If the string is empty, return 0.
// 6. Complexity: O(n) time since each character is processed at most twice (by left and right pointers). Space O(1) or O(26) if we assume only alphabets, but in general O(k) since we store at most k+1 distinct characters.

#include <iostream>
#include <unordered_map>
#include <algorithm>
using namespace std;

class Solution {
public:
    int lengthOfLongestSubstringKDistinct(string s, int k) {
        if (k == 0) return 0;
        unordered_map<char, int> charCount;
        int left = 0, maxLength = 0;

        for (int right = 0; right < s.size(); right++) {
            charCount[s[right]]++;

            // If the number of distinct characters exceeds k, shrink the window from the left.
            while (charCount.size() > k) {
                charCount[s[left]]--;
                if (charCount[s[left]] == 0) {
                    charCount.erase(s[left]);
                }
                left++;
            }

            maxLength = max(maxLength, right - left + 1);
        }

        return maxLength;
    }
};

// Testing
int main() {
    Solution sol;
    cout << sol.lengthOfLongestSubstringKDistinct("eceba", 2) << endl; // Output: 3 ("ece")
    cout << sol.lengthOfLongestSubstringKDistinct("aa", 1) << endl;    // Output: 2 ("aa")
    cout << sol.lengthOfLongestSubstringKDistinct("a", 0) << endl;     // Output: 0
    return 0;
