use std::collections::HashMap;

pub fn count(nucleotide: char, dna: &str) -> Result<usize, char> {
    let mut counts = nucleotide_counts(dna)?;
    match nucleotide {
        'A' | 'C' | 'G' | 'T' => Ok(counts.remove(&nucleotide).unwrap()),
        _ => Err(nucleotide),
    }
}

pub fn nucleotide_counts(dna: &str) -> Result<HashMap<char, usize>, char> {
    let mut counts: HashMap<char, usize> = [('A', 0), ('C', 0), ('G', 0), ('T', 0)]
        .iter()
        .cloned()
        .collect();
    for c in dna.chars() {
        match c {
            'A' | 'C' | 'G' | 'T' => *counts.entry(c).or_insert(0) += 1,
            _ => return Err(c),
        }
    }
    Ok(counts)
}
