// 1. **Problem Analysis**: The problem requires us to find the maximum number of consecutive 1's in a binary array `nums` after flipping at most `k` zeros to ones. This flipping operation allows us to convert up to `k` zeros into ones, which can potentially extend a sequence of consecutive ones.

// 2. **Intuition**: The solution involves using a sliding window approach. The idea is to maintain a window that can contain at most `k` zeros. As we expand the window by including elements from the right, we count the zeros. If the number of zeros exceeds `k`, we shrink the window from the left until the zeros are within the limit again. The maximum window size encountered during this process gives the answer.

// 3. **Algorithm Selection**: The sliding window technique is suitable here because it efficiently tracks the longest contiguous subarray satisfying the condition (at most `k` zeros) in linear time. We use two pointers (left and right) to represent the current window, and a counter for zeros.

// 4. **Complexity Analysis**: The algorithm runs in O(n) time, where n is the length of the array, since each element is processed at most twice (once by the right pointer and once by the left pointer). The space complexity is O(1) as we only use a few extra variables.

// 5. **Code Implementation**:
//    - Initialize `left` to 0, `maxOnes` to 0, and `zeroCount` to 0.
//    - Iterate over the array with `right` pointer:
//        - If `nums[right]` is 0, increment `zeroCount`.
//        - While `zeroCount` exceeds `k`, move `left` pointer forward and decrement `zeroCount` if `nums[left]` was 0.
//        - Update `maxOnes` as the maximum of its current value and the current window size (`right - left + 1`).
//    - Return `maxOnes`.

// 6. **Edge Cases**: 
//    - If `k` is 0, we can only have sequences of actual consecutive ones.
//    - If the entire array is ones, then the answer is the length of the array.
//    - If `k` is greater than or equal to the number of zeros in the array, then the entire array can be flipped to ones.

class Solution {
public:
    int longestOnes(vector<int>& nums, int k) {
        int left = 0;
        int maxOnes = 0;
        int zeroCount = 0;

        for (int right = 0; right < nums.size(); right++) {
            if (nums[right] == 0) {
                zeroCount++;
            }

            while (zeroCount > k) {
                if (nums[left] == 0) {
                    zeroCount--;
                }
                left++;
            }

            maxOnes = max(maxOnes, right - left + 1);
        }

        return maxOnes;
    }
};

