**方法二：深度优先搜索（DFS）**
我们也可以使用DFS来检查是否有环以及是否所有节点都被访问到（连通）。注意，树是无向无环图，所以我们需要避免将父节点误认为环。

步骤：
1. 首先检查边的数量是否为n-1，不是则返回False。
2. 构建邻接表。
3. 从节点0开始DFS遍历，使用一个visited数组记录访问过的节点。
4. 在DFS过程中，对于当前节点u，遍历其邻居v：
