# 1. Problem Analysis
The problem requires us to compute the number of distinct subsequences of a given string `s` that are equal to another string `t`. A subsequence is derived by deleting zero or more characters without changing the order of the remaining characters.

## Constraints:
- `1 <= s.length, t.length <= 1000`
- `s` and `t` consist of English letters.

# 2. Intuition
We can use dynamic programming to solve this problem. The idea is to build a 2D DP array where `dp[i][j]` represents the number of distinct subsequences of `s[0..i-1]` that equals `t[0..j-1]`.

## Approach
1. **DP Array Initialization**: 
   - Create a 2D DP array with dimensions `(n+1) x (m+1)`, where `n` is the length of `s` and `m` is the length of `t`.
   - Initialize `dp[i][0] = 1` for all `i` because there is exactly one way to form an empty string `t` from any prefix of `s` (by deleting all characters).
   - Initialize `dp[0][j] = 0` for `j > 0` because an empty `s` cannot form a non-empty `t`.

2. **DP Array Filling**:
   - For each character in `s` (from index `1` to `n`) and each character in `t` (from index `1` to `m`):
     - If `s[i-1] == t[j-1]`, then we have two choices:
        - We can include the matching character: then we look at the solution for `s[0..i-2]` and `t[0..j-2]` (i.e., `dp[i-1][j-1]`).
        - We can skip the current character in `s`: then we look at the solution for `s[0..i-2]` and `t[0..j-1]` (i.e., `dp[i-1][j]`).
        - Therefore, `dp[i][j] = dp[i-1][j-1] + dp[i-1][j]`.
     - If `s[i-1] != t[j-1]`, then we cannot include the current character of `s` to form `t`, so we simply take the value from the previous row: `dp[i][j] = dp[i-1][j]`.

3. **Result**:
   - The answer is stored in `dp[n][m]`.

# 3. Complexity Analysis
- **Time Complexity**: O(n*m), where `n` is the length of `s` and `m` is the length of `t`. We fill a DP table of size `(n+1) x (m+1)`.
- **Space Complexity**: O(n*m) for the DP table. This can be optimized to O(m) by using a 1D array since we only need the previous row.

# 4. Code
```cpp
class Solution {
public:
    int numDistinct(string s, string t) {
        int n = s.size(), m = t.size();
        vector<vector<unsigned long long>> dp(n+1, vector<unsigned long long>(m+1, 0));

        for (int i = 0; i <= n; i++) {
            dp[i][0] = 1;
        }

        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= m; j++) {
                if (s[i-1] == t[j-1]) {
                    dp[i][j] = dp[i-1][j-1] + dp[i-1][j];
                } else {
                    dp[i][j] = dp[i-1][j];
                }
            }
        }

        return dp[n][m];
    }
};

