### Key Concepts and Functionality

1. **Creating Processes**:
   - **`Runtime.exec()`**: The traditional way to start a process. It's straightforward but less flexible.
     ```java
     Process process = Runtime.getRuntime().exec("command");
     ```
   - **`ProcessBuilder`**: Recommended for more control over process creation. It allows setting the command, environment variables, working directory, and handling input/output redirection.
     ```java
     ProcessBuilder builder = new ProcessBuilder("command", "arg1", "arg2");
     builder.directory(new File("/path/to/dir"));
     builder.redirectErrorStream(true); // Merge error stream with input stream
     Process process = builder.start();
     ```

2. **Handling Input/Output**:
   - Processes have three streams: standard input (`OutputStream`), standard output (`InputStream`), and standard error (`InputStream`). Proper management of these streams is vital to prevent deadlocks, especially when the process generates a lot of output.
   - **Reading Output**: Use separate threads to read the output and error streams to avoid blocking.
     ```java
     new Thread(() -> {
         try (BufferedReader reader = new BufferedReader(new InputStreamReader(process.getInputStream()))) {
             String line;
             while ((line = reader.readLine()) != null) {
                 // Process output
             }
         } catch (IOException e) {
             e.printStackTrace();
         }
     }).start();
     ```
   - **Writing Input**: If the process expects input, write to the process's output stream (yes, it's the input for the process).
     ```java
     try (OutputStream os = process.getOutputStream();
          BufferedWriter writer = new BufferedWriter(new OutputStreamWriter(os))) {
         writer.write("input data");
         writer.flush();
     }
     ```

3. **Waiting for Completion**:
   - Use `waitFor()` to block until the process terminates. This method returns the exit value of the process.
     ```java
     int exitCode = process.waitFor();
     ```
   - To avoid indefinite blocking, consider using `waitFor(long timeout, TimeUnit unit)` (Java 8+), which allows specifying a timeout.

4. **Destroying Processes**:
   - If a process needs to be terminated forcibly, use `destroy()` or `destroyForcibly()` (Java 8+). The latter is more aggressive and is useful if `destroy()` doesn't work.
   - It's good practice to call `destroy()` in a `finally` block or use try-with-resources for `Process` objects (though `Process` doesn't implement `AutoCloseable` directly, you can wrap it).

5. **Exit Value and Status**:
   - Check if the process has terminated using `isAlive()`.
   - Retrieve the exit value with `exitValue()`, but note that calling this before the process has terminated will throw an `IllegalThreadStateException`.

### Best Practices

- **Stream Handling**: Always consume the output and error streams. Neglecting them can cause the process to block when its output buffers fill up.
- **Timeouts**: Use timeouts with `waitFor` to prevent hanging indefinitely.
